import { Card } from "react-bootstrap";
import Background from "../../components/Bg";

function About() {
  return (
    <Background>
        <Card>
            <Card.Body>
                <Card.Text>hey</Card.Text>
            </Card.Body>
        </Card>
    </Background>
  );
};
export default About;
